    fetch("https://jsonplaceholder.typicode.com/comments")
      .then((response) => response.json())
      .then((json) => setdata(json));

    console.log(data);
  });

  return (
    <>
      {data.map(() => (
        <>
          <div>
            <div><h5></h5></div>
            <div><h3></h3></div>
            <div><p></p></div>
          </div>
        </>
      ))}
    </>
  );
};
export default C;
